}
const Auth = ({authRoute }) => {

    
    const {authState : {authLoading , isAuthenticated}} = useContext()

    return (
        <>
        <h1>Trang Chu</h1>
                
                {
                    authRoute === 'Register' && <Register></Register>
                }
                {
                    authRoute === 'login' && <Login></Login>
                }
        </>
    )
}
